import { createBrowserRouter, RouterProvider } from 'react-router-dom';

import { ThemeProvider } from 'styled-components';

import theme from '../../styles/theme';
import GlobalStyles from '../../styles/GlobalStyles';
import HomePage from '../../pages/Home';
import SalesPage from '../../pages/Sales';
import WatchListPage from '../../pages/WatchList';
import ChatPage from '../../pages/Chat';
import ErrorPage from '../../pages/Error';
import Login from '../../pages/Login';
import CategoryPage from '../../pages/Category';
import Layout from '../Layout';
import Account from '../../pages/Account';
import SalesMyItemPage from '../../pages/SalesMyItem';
import ChattingPage from '../../pages/Chatting';
import { LocationPage } from '../../pages/Location';
import { LocationSetPage } from '../../pages/LocationSet';
import {
  ACCOUNT,
  CALL_BACK,
  CHAT,
  WATCHLIST,
  HOME,
  LOGIN,
  SALES,
  CATEGORY,
  SALES_ITEM,
  REGISTER,
  ITEM_DETAIL,
  CHATROOM,
  LOCATION,
  LOCATION_SET,
  CATEGORY_SET,
} from '../../constants/routeUrl';
import { AuthProvider } from '../../context/Auth';
import ProtectedRoute from '../ProtectedRoute';
import Callback from '../Callback/';
import Register from '../../pages/Register';
import ItemDetailPage from '../../pages/ItemDetail';
import { CategorySetPage } from '../../pages/CategorySet';

const router = createBrowserRouter([
  {
    path: '/',
    element: <Layout />,
    errorElement: <ErrorPage />,
    children: [
      {
        path: `${HOME}/:categoryId?`,
        element: <HomePage />,
      },
      {
        path: SALES,
        element: (
          <ProtectedRoute>
            <SalesPage />
          </ProtectedRoute>
        ),
      },
      {
        path: WATCHLIST,
        element: (
          <ProtectedRoute>
            <WatchListPage />
          </ProtectedRoute>
        ),
      },
      {
        path: CHAT,
        element: (
          <ProtectedRoute>
            <ChatPage />
          </ProtectedRoute>
        ),
      },
      {
        path: ACCOUNT,
        element: (
          <ProtectedRoute>
            <Account />
          </ProtectedRoute>
        ),
      },
      { path: LOGIN, element: <Login /> },
      { path: CALL_BACK, element: <Callback /> },
    ],
  },

  {
    path: CATEGORY,
    element: <CategoryPage />,
  },
  {
    path: CATEGORY_SET,
    element: <CategorySetPage />,
  },
  {
    path: SALES_ITEM,
    element: (
      <ProtectedRoute>
        <SalesMyItemPage />
      </ProtectedRoute>
    ),
  },
  { path: REGISTER, element: <Register /> },
  {
    path: `${ITEM_DETAIL}/:productsId`,
    element: (
      <ProtectedRoute>
        <ItemDetailPage />
      </ProtectedRoute>
    ),
  },
  { path: `${CHATROOM}/:roomId`, element: <ChatRoomList /> },
  { path: LOCATION, element: <LocationPage /> },
  { path: LOCATION_SET, element: <LocationSetPage /> },
]);

const App = () => {
  return (
    <AuthProvider>
      <ThemeProvider theme={theme}>
        <GlobalStyles />
        <RouterProvider router={router} />
      </ThemeProvider>
    </AuthProvider>
  );
};

export default App;
